import React, { useState, useEffect } from 'react';

function Employees() {

    const [employees, setEmployees] = useState([]);

    const getEmployees = () => {
        fetch('/employees')
            .then(response => {
                return response.json()
            })
            .then(data => {
                setEmployees(data)
            })
            .catch(error => console.log(error.message));
    }

    useEffect(() => {
        getEmployees()
    }, []);

    return (
        <div>
            <h2>Employees</h2>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Value</th>
                    </tr>
                </thead>
                <tbody>
                    {employees.map((employee) => (
                        <tr>
                            <td>{employee.name}</td>
                            <td>{employee.value}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}
